        raise ImportError('RemoteMonitor requires '
                          'the `requests` library.')
    logs = logs or {}
    send = {}
    send['epoch'] = epoch
    for k, v in logs.items():
        if isinstance(v, (np.ndarray, np.generic)):
            send[k] = v.item()
        else:
